import React from 'react';
import { Redirect } from 'react-router-dom';
import { RenderRoutes, protect } from './routesHelpers';
import {
  Intro,
  Home,
  Test,

} from 'pages';

export const Routes = [
  {
    path: '/',
    key: 'root',
    exact: true,
    component: Intro
  },
  {
    path: '/intro',
    key: 'intro',
    exact: true,
    component: () => <Redirect to={'/'} />
  },
  {
    path: '/home',
    key: 'home',
    exact: true,
    component: Home
  },
  {
    path: '/test',
    key: 'test',
    exact: true,
    component: Test
  },
  {
    path: '/onboarding',
    key: 'onboarding-index',
    component: RenderRoutes,
    routes: ObRoutes,
  },

